import photo from './../images/HL WONG 3.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLink } from '@fortawesome/free-solid-svg-icons';
import { faGithub } from '@fortawesome/free-brands-svg-icons';

export default function Main() {
    return (
        <main className="main">
            <div className="digital-business-card">
                <img src={photo} alt="photo" className="card__photo"/>
                <div className="card__info">
                    <h1 className="info__name">HL Wong</h1>
                    <p className="info__occupation">Student</p>
                    <div className="btn__container">
                        <button className="btn__website"><FontAwesomeIcon icon={faLink} size="lg" className="mr-5"/> Website</button>
                        <button className="btn__github"><FontAwesomeIcon icon={faGithub} size="lg"/> GitHub</button>
                    </div>
                </div>
            </div>
        </main>
    )
}
